import React from "react";
import Navbar from "../halaman1/navbar/navbar"




function Profil() {
    return (
      <>
        <Navbar />
        
        <div class="container"><div class="row" id="perusahaan1"><div class="col-md-6 m-auto text-center"><h1>Your Site, Your Way.</h1><p class="lead">See how your users experience your website in realtime or view trends to see any changes in performance over time.</p></div></div></div>

      </>
   );
  }

  export default Profil;
